import React from 'react';
import styled from 'styled-components';

export const TheFooter = () => {
  return (
    <Buttons>
      <Button>
      </Button>
    </Buttons>
  );
};

const Buttons = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 20px;
`;

const Button = styled.button`
  background-color: #1447e6;
  color: white;
  border: none;
  border-radius: 5px;
  padding: 10px 20px;
  margin: 0 10px;
  cursor: pointer;
`;
